import Header from "../components/Header";
import { Main, Content } from "../styles";
import "../style.css";

function Index() {
    return (
        <div>
            <Main>
                <Header />
                <Content>
                    <h1>Hi, my name is Orion.</h1>
                    <p>Here's some stuff about me.</p>
                </Content>
            </Main>
        </div>
    );
}

export default Index;
